function Home() {
  return (
    <>
      <div
        style={{
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          height: '40vh'
        }}
      >
        <h1>Find The Job You Love !</h1>
      </div>
      <div
       style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '-2vh'
      }}>
       
        <h4>Lebanons #1 Job Site</h4>

      </div>
    </>
  );
};




export default Home;
